"""
Embedded Courier New Bold font for PianoTab application.
This module contains a base64-encoded Courier New Bold TTF font.
"""

import os
import tempfile
import base64
from typing import Optional

# Base64-encoded Courier New Bold font
COURIER_NEW_BOLD_B64 = """"""

class EmbeddedFontManager:
    """Manages the embedded Courier New font for the application."""
    
    def __init__(self):
        self._temp_font_path: Optional[str] = None
        self._temp_dir: Optional[str] = None
    
    def get_monospace_font_path(self) -> str:
        """Get the path to the embedded Courier New Bold font.
        
        Creates a temporary file with the embedded font data if needed.
        Returns the path to the font file.
        """
        if self._temp_font_path and os.path.exists(self._temp_font_path):
            return self._temp_font_path
        
        # Create temporary directory if needed
        if not self._temp_dir:
            self._temp_dir = tempfile.mkdtemp(prefix="pianotab_fonts_")
        
        # Decode and write the font data
        try:
            font_data = base64.b64decode(COURIER_NEW_BOLD_B64)
            self._temp_font_path = os.path.join(self._temp_dir, "courier_new_bold.ttf")
            
            with open(self._temp_font_path, 'wb') as f:
                f.write(font_data)
            
            print(f"Using embedded Courier New Bold font: {self._temp_font_path}")
            return self._temp_font_path
        except Exception as e:
            # Fallback to system fonts if embedding fails
            print(f"Warning: Could not extract embedded font: {e}")
            fallback_paths = [
                "/usr/share/fonts/truetype/msttcorefonts/Courier_New_Bold.ttf",
                "/usr/share/fonts/truetype/msttcorefonts/courbd.ttf",
                "Courier New Bold",
                "Courier New",
                "monospace"
            ]
            for path in fallback_paths:
                if path.endswith('.ttf') and os.path.exists(path):
                    print(f"Using fallback font: {path}")
                    return path
                elif not path.endswith('.ttf'):
                    print(f"Using font family: {path}")
                    return path
            return "monospace"
    
    def cleanup(self):
        """Clean up temporary font files."""
        if self._temp_font_path and os.path.exists(self._temp_font_path):
            try:
                os.remove(self._temp_font_path)
            except OSError:
                pass
        
        if self._temp_dir and os.path.exists(self._temp_dir):
            try:
                os.rmdir(self._temp_dir)
            except OSError:
                pass

# Global instance
_font_manager = EmbeddedFontManager()

def get_embedded_monospace_font() -> str:
    """Get the path to the embedded Courier New Bold font."""
    return _font_manager.get_monospace_font_path()

def cleanup_embedded_fonts():
    """Clean up temporary font files."""
    _font_manager.cleanup()
